import {MovieInterface} from "../Interface/ResponsesInterfaces";

export default function Movies({movies}: { movies: MovieInterface }) {
    return (
        <div className='col bg-light rounded p-3 mb-3'>
            <img src={require(`../assets/images/films/${movies.affiche}`)} />
            <h3>{movies.name}</h3>
            <p>
                <small>
                    Par : {movies.creator}
                    <br/>
                    Sortie le : {movies.published}
                </small>
            </p>

            <button type="button" class="btn btn-warning">Voir plus</button>
        </div>
    )
}
